import React, { useState, useEffect } from 'react';
import axios from 'axios';

const FinancialData = () => {
  const [data, setData] = useState([]);
  const [error, setError] = useState(null);
  const [loading, setLoading] = useState(true);

  // Filters and sorting states
  const [sortBy, setSortBy] = useState('');
  const [order, setOrder] = useState('asc');
  const [filterBy, setFilterBy] = useState('');
  const [filterValueMin, setFilterValueMin] = useState('');
  const [filterValueMax, setFilterValueMax] = useState('');

  useEffect(() => {
    fetchData();
  }, [sortBy, order, filterBy, filterValueMin, filterValueMax]);

  const fetchData = async () => {
    setLoading(true);
    setError(null);

    try {
      const params = {};
      if (sortBy) params.sort_by = sortBy;
      if (order) params.order = order;
      if (filterBy) {
        params.filter_by = filterBy;
        if (filterValueMin) params.filter_value_min = filterValueMin;
        if (filterValueMax) params.filter_value_max = filterValueMax;
      }

      const response = await axios.get('http://localhost:5000/api/data', { params });
      setData(response.data);
    } catch (err) {
      setError(err.response?.data?.error || 'Failed to fetch data');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div>
      <h1>Financial Data</h1>

      {error && <p style={{ color: 'red' }}>{error}</p>}

      {/* Filters and Sorting Controls */}
      <div>
        <label>Sort By:</label>
        <select value={sortBy} onChange={(e) => setSortBy(e.target.value)}>
          <option value="">None</option>
          <option value="date">Date</option>
          <option value="revenue">Revenue</option>
          <option value="netIncome">Net Income</option>
        </select>

        <label>Order:</label>
        <select value={order} onChange={(e) => setOrder(e.target.value)}>
          <option value="asc">Ascending</option>
          <option value="desc">Descending</option>
        </select>

        <label>Filter By:</label>
        <select value={filterBy} onChange={(e) => setFilterBy(e.target.value)}>
          <option value="">None</option>
          <option value="date">Date</option>
          <option value="revenue">Revenue</option>
          <option value="netIncome">Net Income</option>
        </select>

        {filterBy && (
          <>
            <label>Min:</label>
            <input
              type="number"
              value={filterValueMin}
              onChange={(e) => setFilterValueMin(e.target.value)}
            />

            <label>Max:</label>
            <input
              type="number"
              value={filterValueMax}
              onChange={(e) => setFilterValueMax(e.target.value)}
            />
          </>
        )}

        <button onClick={fetchData}>Apply</button>
      </div>

      {/* Data Table */}
      {loading ? (
        <p>Loading...</p>
      ) : (
        <table border="1">
          <thead>
            <tr>
              <th>Date</th>
              <th>Revenue</th>
              <th>Net Income</th>
            </tr>
          </thead>
          <tbody>
            {data.map((item, index) => (
              <tr key={index}>
                <td>{item.date}</td>
                <td>{item.revenue}</td>
                <td>{item.netIncome}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
};

export default FinancialData;
